import React from "react";
import PokemonInfoCard from "./PokemonInfoCard";
import PokemonMovesCard from "./PokemonMovesCard";

const PokemonPage = ({
  currentSelectedPokemon,
  pokemonData,
  handleBackButton,
  formatText,
}) => {
  console.log(pokemonData[currentSelectedPokemon]);
  return (
    <>
      <button onClick={handleBackButton}> Back</button>
      {/* {pokemonData[currentSelectedPokemon].name}
       */}
      <div className="flex gap-4  justify-center">
        <div className="">
          <PokemonInfoCard
            pokemonData={pokemonData}
            currentSelectedPokemon={currentSelectedPokemon}
          />
        </div>
        <div className="mx-20 w-3/5 my-4 border">
          <PokemonMovesCard
            pokemonData={pokemonData}
            currentSelectedPokemon={currentSelectedPokemon}
            formatText={formatText}
          />
        </div>
      </div>
    </>
  );
};

export default PokemonPage;
